import React from 'react'
import styled from 'styled-components'

const UserPicture = styled.div`
height: 100px;
width: 100px;
border-radius: 50%;
background-color: purple;
back
`


export default function UserPic() {
  return (
    <UserPicture></UserPicture>
  )
}
